import classes from "./Navigation.module.css";

const Navigation = () => {
  return (
    <nav className={classes.nav}>
      <ul>
        {ctx.isLoggedIn && (
          <li>
            <Button onClick={ctx.onLogout}>Logout</Button>
            {/* this is the native onClick event, and on a click, we will innoke onLogout */}
          </li>
        )}
      </ul>
    </nav>
  );
};
